  `ID_` bigint NOT NULL,
  `HOST_IP_` varchar(255) DEFAULT NULL COMMENT '请求ip',
  `USERNAME_` varchar(255) DEFAULT NULL COMMENT '用户名',
  `URL_` varchar(255) DEFAULT NULL COMMENT '请求地址',
  `PARAMS_` text COMMENT '参数',
  `REQUEST_METHOD_` varchar(255) DEFAULT NULL COMMENT '请求方式',
  `NOTES_` text COMMENT '备注',
  `CREATOR_` bigint DEFAULT NULL COMMENT '创建人员',
  `MODIFIER_` bigint DEFAULT NULL COMMENT '更新人员',
  `MODIFY_TIME_` datetime DEFAULT NULL COMMENT '更新时间',
  `CREATE_TIME_` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`ID_`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of sys_log
-- ----------------------------


-- ----------------------------
-- Table structure for sys_login_info
-- ----------------------------
DROP TABLE IF EXISTS `sys_login_info`;
CREATE TABLE `sys_login_info` (
  `ID_` bigint NOT NULL,
  `USERNAME_` varchar(255) DEFAULT NULL COMMENT '用户名',
  `IP_ADDR_` varchar(255) DEFAULT NULL COMMENT 'IP地址',
  `LOGIN_LOCATION_` varchar(255) DEFAULT NULL COMMENT '登录位置',
  `BROWSER_` varchar(255) DEFAULT NULL COMMENT '浏览器',
  `OS_` varchar(255) DEFAULT NULL COMMENT '操作系统',
  `STATUS_` varchar(1) DEFAULT NULL COMMENT '状态',
  `MSG_` varchar(255) DEFAULT NULL COMMENT '消息',
  `LOGIN_TIME_` datetime DEFAULT NULL COMMENT '登陆时间',
  `CREATOR_` bigint DEFAULT NULL COMMENT '创建人员',
  `CREATE_TIME_` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `MODIFIER_` bigint DEFAULT NULL COMMENT '更新人员',
  `MODIFY_TIME_` timestamp NULL DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`ID_`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

-- ----------------------------
-- Records of sys_login_info
-- ----------------------------

-- ----------------------------
-- Table structure for sys_menu
-- ----------------------------
DROP TABLE IF EXISTS `sys_menu`;
CREATE TABLE `sys_menu` (
  `ID_` bigint NOT NULL COMMENT 'id',
  `NAME_` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '权限名称',
  `DESCRIPTION_` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '权限描述',
  `PATH_` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '路由地址',
  `URL_` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '授权链接',
  `IS_BLANK_` int DEFAULT '0' COMMENT '是否跳转 0 不跳转 1跳转',
  `PID_` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '父节点id',
  `ICON_` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '菜单图标',
  `ORDER_` int DEFAULT NULL COMMENT '排序',
  `VISIBLE_` int DEFAULT NULL COMMENT '是否可见',
  `PERMS_` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `TYPE_` int DEFAULT NULL,
  `CREATOR_` bigint DEFAULT NULL,
  `CREATE_TIME_` datetime DEFAULT NULL,
  `MODIFIER_` bigint DEFAULT NULL,
  `MODIFY_TIME_` datetime DEFAULT NULL,
  PRIMARY KEY (`ID_`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='菜单表';

