-- ----------------------------
-- Table structure for sys_notice
-- ----------------------------
DROP TABLE IF EXISTS `sys_notice`;
CREATE TABLE `sys_notice` (
  `ID_` bigint NOT NULL COMMENT '公告ID',
  `NOTICE_TITLE_` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '公告标题',
  `NOTICE_TYPE_` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '公告类型（1通知 2公告）',
  `NOTICE_CONTENT_` varchar(2000) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '公告内容',
  `NOTICE_STATUS_` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '公告状态（0正常 1关闭）',
  `DEADLINE_` datetime DEFAULT NULL COMMENT '有效时间',
  `CREATOR_` bigint DEFAULT NULL COMMENT '创建者',
  `CREATE_TIME_` datetime DEFAULT NULL COMMENT '创建时间',
  `MODIFIER_` bigint DEFAULT NULL COMMENT '更新者',
  `MODIFY_TIME_` datetime DEFAULT NULL COMMENT '更新时间',
  `REMARK_` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '备注'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC COMMENT='通知公告表';

